const fillImg = 'data:image/png;base64,'
const bgImg = 'data:image/png;base64,'

const tag = 'data:image/png;base64,'

class ScoreLine {
  constructor(option) {
    this.option = Object.assign({}, option);
    this.init();
  }
  
  loadImage(data) {
    var img = new Image();
    return new Promise((resolve, reject) => {
      img.src = data;
      img.onload = function () {
        resolve(img);
      }
      img.onerror = function (e) {
        reject(e);
      }
    })
  }
  dealOption(ratio) {
    this.ratio = ratio || 1;
    const _opt = this.option;
    _opt.padding = {
      top: _opt.padding.top * ratio,
      left: _opt.padding.left * ratio,
      right: _opt.padding.right * ratio,
      bottom: _opt.padding.bottom * ratio
    }
    _opt.width = _opt.width * ratio;
    _opt.height = _opt.height * ratio;
    _opt.line.width = _opt.line.width * ratio;
    this._option = _opt;
  }
  async init() {
    var canvas = document.createElement('canvas');
    var ctx = canvas.getContext('2d');
    var devicePixelRatio = window.devicePixelRatio || 1;
    var backingStoreRatio = ctx.webkitBackingStorePixelRatio || 1;
    var ratio = devicePixelRatio / backingStoreRatio;
    this.ctx = ctx;
    this.dealOption(ratio);
    const option = this._option;
    const padding = this._option.padding;
    this.scaleW = option.width - (padding.left + padding.right);
    
    const step = (option.max - option.min) / 5;
    let scales = [option.min];
    var len = scales.length;
    while(scales[len - 1] < option.max) {
      scales.push(option.min + (len * step))
      len = scales.length;
    }
    var gutter = this.scaleW / (scales.length - 1);
    this.scales = scales;
    this.gutter = gutter;
    
    canvas.width = option.width;
    canvas.height = option.height;
    this.bgImg = await this.loadImage(this._option.bgImg);
    this.lineImg = await this.loadImage(this._option.frontImg);
    this.tagImg = await this.loadImage(this._option.tagImg);
    ctx.fillStyle = option.backgroundColor;
    ctx.fillRect(0, 0, option.width, option.height);
    var el = document.querySelector(this.option.el);
    el.appendChild(canvas);
    canvas.style.width = el.style.width;
    if (this._option.ready) {
      this._option.ready()
    }
  }
  cleanScreen() {
    const option = this._option;
    this.ctx.fillStyle = option.backgroundColor;
    this.ctx.fillRect(0, 0, option.width, option.height);
  }
  async drawScreen() {
    this.cleanScreen();
    const option = this._option;
    const padding = this._option.padding;
    var rate = this.rate || 0;
    var bg = this.bgImg;
    const ctx = this.ctx;
    var dW = this.scaleW;
    var dH = dW * bg.height / bg.width
    var colCount = this._option.scale.grids * 2 - 1;
    var col = dW / colCount;
    var d = Math.floor(dW * rate / col);
    var offset = d * col;
    const offsetTop = (d % 18 === 0 || d === colCount ? 8 : 15) * this.ratio;
    offset = d % 2 == 0 ? offset + 2 * col : offset + col;
    // 
    ctx.drawImage(bg, 0, 0, bg.width, bg.height, padding.left, padding.top, dW, dH);
    var line = this.lineImg;
    // 
    ctx.drawImage(line, 0, 0, line.width * rate, line.height, padding.left, padding.top, dW * rate, dH + 2 * this.ratio);
    ctx.save();
    // 
    ctx.beginPath();
    ctx.translate(0, -offsetTop)
    ctx.rect(offset, padding.top, 1.5 * col, dH + offsetTop + 3 * this.ratio);
    ctx.clip();
    ctx.drawImage(line, 0, 0, line.width, line.height, padding.left, padding.top, dW, dH + offsetTop + 3 * this.ratio);
    ctx.translate(0, offsetTop);
    
    ctx.restore();
    // 
    // 
    const tagImage = this.tagImg
    const tW = dW / 10;
    const tH = tW * tagImage.height / tagImage.width;
    ctx.drawImage(tagImage, 0, 0, tagImage.width, tagImage.height, offset - tW / 2 + col / 2, padding.top - dH / 2 - 20 * this.ratio, tW, tH)
    ctx.save()
    // 
    ctx.beginPath()
    ctx.fillStyle = '#fff'
    ctx.textAlign = option.font.align
    ctx.font = option.font.family
    ctx.fillText(this.value, offset + col / 2, padding.top - tH / 2 - 15 * this.ratio, tW)
    ctx.closePath()
    ctx.restore()
    // 
    this.drawScale(dW, dH + padding.top);
  }
  async drawScale(width, height) {
    const option = this._option;
    const padding = this._option.padding;
    const font = this._option.font;
    const line = this._option.line;
    const scale = this._option.scale;
    const ctx = this.ctx;
    var colCount = scale.grids * 2 - 1;
    var col = width / colCount;
    var tags = scale.tags;
    var colors = scale.colors;
    var defaultColor = scale.defaultColor;
    
    ctx.setLineDash([3,3]);
    ctx.lineWidth = line.width;
    ctx.beginPath();
    let scales = this.scales;
    var gutter = this.gutter;
    const len = scales.length;
    for(var i = 0; i < len; i++) {
      var x = col / 2 + gutter * i + padding.left;
      ctx.moveTo(x, height + 8 * this.ratio);
      ctx.lineTo(x, option.height - 10 * this.ratio);
      ctx.strokeStyle = line.color;
      ctx.stroke();
      ctx.fillStyle = font.color;
      ctx.font = font.family;
      ctx.textAlign = font.align;
      ctx.fillText(scales[i], x, option.height)
      if (i < len - 1) {
        if (this.value > scales[i]) {
          ctx.fillStyle = colors[i]
        } else {
          ctx.fillStyle = defaultColor;
        }
        ctx.fillText(tags[i], x + gutter / 2, height + 20 * this.ratio);
      }
    }
  }
  async setValue(val, duration) {
    let start = this._option.min;
    let step = duration;
    let isEnd = false;
    let c = 1;
    const drawCb = () => {
      c++
      if (!isEnd) {
        if (start >= val) {
          start = val
          isEnd = true
        }
        this._setValue(start)
        start += step;
        window.requestAnimationFrame(drawCb);
      }
    }
    if (isNaN(duration)) {
      this._setValue(val)
    } else {
      window.requestAnimationFrame(drawCb)
    }
  }
  async _setValue (val) {
    const option = this._option;
    if (val < option.min) {
      val = option.min;
    } else if (val > option.max) {
      val = option.max;
    }
    this.value = val;
    var total = option.max - option.min;
    var left = val - option.min;
    this.rate = left / total
    await this.drawScreen();
  }
}

var sl = new ScoreLine({
  el: '#line',
  tagImg: tag,
  bgImg: bgImg,
  frontImg: fillImg,
  width: 400, //  400
  height: 180,
  min: 300,
  max: 950,
  scale: {
    tags: ['', '', '', '', ''],
    colors: ['#20B1D8', '#AEC48C', '#F9B15F', '#FC874F', '#FF0000'],
    defaultColor: '#949DB0',
    grids: 46,
  },
  padding: {
    top: 50,
    left: 10,
    right: 30,
    bottom: 10
  },
  backgroundColor: '#fff',
  font: {
    family: '24px sans-serif',
    align: 'center',
    color: '#949DB0'
  },
  line: {
    color: '#EAEAEA',
    width: 1
  },
  ready() {
    sl.setValue(820, 10)
  }
});
